import React, {Component} from 'react';
import {
	HeaderWrapper,
	LogoPic
}from './style.js'

class Header extends Component {
	render() {
		return (
			<HeaderWrapper>
				<LogoPic />
			</HeaderWrapper>
		)
	}
}

export default Header;
